 of the forest which is a designated wildlife preserve and historic site. Call 786-719-9903 to schedule a visit or reserve the estate for your Wedding, photo shoot or other special event. #garden #forest #tropical #patchofheavensanctuary #nature #heaven #sanctuary #tree #visit #beautiful #miami #historic #experience #tour #wedding #flowers #venue #mystical #paradise #sacred #explore #environment #walk #relax #zen #meditation #steps #path";}i:17;a:1:{s:14:"comments_count";i:0;}i:18;a:1:{s:11:"likes_count";i:6;}i:19;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvAcNtgYav";}i:20;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/118878824_368325807687159_7595402235975158902_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=103&_nc_ohc=jflStZG_n3wAX_jj2Fh&oh=a07816fb2b48edd0f966ca9400b46d7a&oe=5F7A87D0";}i:21;a:1:{s:4:"type";s:5:"image";}i:22;a:1:{s:8:"owner_id";i:3020021525;}i:23;a:1:{s:14:"owner_username";s:0:"";}i:24;a:1:{s:14:"owner_fullname";s:0:"";}i:25;a:1:{s:9:"owner_pic";s:0:"";}i:26;a:1:{s:2:"id";s:19:"2391131345069440024";}i:27;a:1:{s:10:"short_code";s:11:"CEvAUoiKnwY";}i:28;a:1:{s:12:"created_time";i:1599265090;}i:29;a:1:{s:7:"caption";s:615:"This illustration, created by Dudley Heath around 1912, depicts a legend from the Gallic sack of Rome, an event traditionally dated to 490 BCE. For more on the history behind this scene, go to thehistorianshut.com (or use the linkin.bio link on our Instagram profile page). #history #historic #art #arthistory #historyart #artwork #artoftheday #painting #paintingoftheday #paintings #pictures #picture #pictureoftheday #images #Image #imageoftheday #picturebook #picturebookillustration #drawings #drawing #drawingoftheday #learning #education #Romans #trivia #didyouknow #ancient #ancientart #ancientimages #prints";}i:30;a:1:{s:14:"comments_count";i:0;}i:31;a:1:{s:11:"likes_count";i:2;}i:32;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvAUoiKnwY";}i:33;a:1:{s:5:"image";s:238:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e15/118728324_3226539034107300_211760642561340834_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=100&_nc_ohc=E6dBRqrvlb0AX8Fljng&oh=b120f85072993208d9906db3e6d0a48d&oe=5F7D5E0C";}i:34;a:1:{s:4:"type";s:5:"image";}i:35;a:1:{s:8:"owner_id";i:31511786587;}i:36;a:1:{s:14:"owner_username";s:0:"";}i:37;a:1:{s:14:"owner_fullname";s:0:"";}i:38;a:1:{s:9:"owner_pic";s:0:"";}i:39;a:1:{s:2:"id";s:19:"2391130992636587215";}i:40;a:1:{s:10:"short_code";s:11:"CEvAPgTh-zP";}i:41;a:1:{s:12:"created_time";i:1599265048;}i:42;a:1:{s:7:"caption";s:2186:"The Paris Mason Building is a vernacular limestone house built according to the hall and parlor plan circa 1840 in Grafton, Illinois. Paris Mason was born in 1786 in Grafton, Massachusetts. By 1815 he was a merchant in New York City, but by 1820 he and two of his brothers had settled in Edwardsville, Illinois. James, Paris' older brother, engaged in land speculation buying up land where he would found Grafton in 1832 as a commercial hub on the Mississippi River. James died before this plan could be fully realized so his widow, Sarah, allowed Paris to lay out the town of Grafton, Illinois in 1836. Paris ran the first general store and the first ferry in town. By 1840 James' only child, Martha, had married William Allen soon after gaining control of James' estate. As a result Paris had a falling out with the family and moved with his wife, Harriett, and their children about two miles to the west to Mason Hollow. He then built this stone house and warehouse close to the bank of the Mississippi which is now several block further south. He ran this business and served as postmaster of Grafton until his death circa 1853. In the Flood of 1993 large parts of Grafton were underwater including the Mason Building because the town has never had a floodwall or levee. The first floor of the building was gutted after the flood so the only historically significant parts that are left are the second floor, the masonry, and the front porch. After the flood this building and many others in town were listed on the National Register of Historical Places to help recognize their historic value. The building was sold last month which is why it has the for sale sign out front.

